 * @title MemoryRegistryV2
 * @notice Upgradeable smart contract for registering and validating memory artifacts on-chain.
 * @dev Uses UUPS (Universal Upgradeable Proxy Standard) pattern with OpenZeppelin contracts.
 *
 * Features:
 * - Submit memories with IPFS CID and content hash
 * - Validator network submits validation scores
 * - Reputation tracking for contributors and validators
 * - Events for off-chain indexing
 */
contract MemoryRegistryV2 is
    Initializable,
    UUPSUpgradeable,
    OwnableUpgradeable,
    AccessControlUpgradeable
{
    // ==================== Constants ====================
    bytes32 public constant VALIDATOR_ROLE = keccak256("VALIDATOR_ROLE");

    // ==================== Structs ====================
    /// @notice Stores metadata about a submitted memory
    struct Memory {
        uint256 id;
        address submitter;
        string ipfsCid;
        bytes32 contentHash;
        uint256 submittedAt;
        uint16 validationScore; // 0-1000
        uint8 validationCount;
        bool isValidated;
        string category;
        string title;
    }

    /// @notice Validation record from a single validator
    struct ValidationRecord {
        address validator;
        bool isValid;
        uint16 score;
        string explanation;
        uint256 submittedAt;
    }

    // ==================== State Variables ====================
    uint256 public nextMemoryId;
    mapping(uint256 => Memory) public memories;
    mapping(uint256 => ValidationRecord[]) public validationHistory;
    mapping(address => uint256) public submitterReputation;
    mapping(address => uint256) public validatorReputation;

    // ==================== Events ====================
    /// @notice Emitted when a memory is submitted
    event MemorySubmitted(
        uint256 indexed memoryId,
        address indexed submitter,
        string ipfsCid,
        bytes32 contentHash,
        string title,
        string category
    );

    /// @notice Emitted when a memory is validated
    event MemoryValidated(
        uint256 indexed memoryId,
        address indexed validator,
        bool isValid,
        uint16 score,
        string explanation
    );

    /// @notice Emitted when reputation is updated
    event ReputationUpdated(
        address indexed user,
        uint256 newReputation,
        string userType // "submitter" or "validator"
    );

    /// @notice Emitted when a validator is registered/unregistered
    event ValidatorStatusChanged(address indexed validator, bool isActive);

    // ==================== Modifiers ====================
    /// @dev Ensures caller is an authorized validator
    modifier onlyValidator() {
        require(hasRole(VALIDATOR_ROLE, msg.sender), "Not a validator");
        _;
    }

    // ==================== Initialization ====================
    /// @notice Initialize the contract (replaces constructor in upgradeable pattern)
    function initialize() public initializer {
        __Ownable_init(msg.sender);
        __AccessControl_init();
        __UUPSUpgradeable_init();

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        nextMemoryId = 1;
    }

    // ==================== Memory Submission ====================
    /**
     * @notice Submit a new memory to the registry
     * @param _ipfsCid IPFS Content Identifier (string)
     * @param _contentHash SHA-256 hash of the memory content
     * @param _title Human-readable title
     * @param _category Category tag (e.g., "history", "science", "art")
     * @return memoryId The ID of the newly submitted memory
     */
    function submitMemory(
        string calldata _ipfsCid,
        bytes32 _contentHash,
        string calldata _title,
        string calldata _category
    ) external returns (uint256) {
        require(bytes(_ipfsCid).length > 0, "CID cannot be empty");
        require(_contentHash != bytes32(0), "Content hash cannot be zero");
        require(bytes(_title).length > 0, "Title cannot be empty");

        uint256 memoryId = nextMemoryId++;

        Memory storage newMemory = memories[memoryId];
        newMemory.id = memoryId;
        newMemory.submitter = msg.sender;
        newMemory.ipfsCid = _ipfsCid;
        newMemory.contentHash = _contentHash;
        newMemory.submittedAt = block.timestamp;
        newMemory.validationScore = 0;
        newMemory.validationCount = 0;
        newMemory.isValidated = false;
        newMemory.category = _category;
        newMemory.title = _title;

        // Award initial reputation to submitter
        submitterReputation[msg.sender] += 10;
        emit ReputationUpdated(
            msg.sender,
            submitterReputation[msg.sender],
            "submitter"
        );

        emit MemorySubmitted(
            memoryId,
            msg.sender,
            _ipfsCid,
            _contentHash,
            _title,
            _category
        );

        return memoryId;
    }

    // ==================== Validation ====================
    /**
     * @notice Submit validation for a memory
     * @param _memoryId ID of memory to validate
     * @param _isValid Whether the content is valid
     * @param _score Validation score (0-1000)
     * @param _explanation Brief explanation of validation
     */
    function submitValidation(
        uint256 _memoryId,
        bool _isValid,
        uint16 _score,
        string calldata _explanation
    ) external onlyValidator {
        require(_memoryId > 0 && _memoryId < nextMemoryId, "Invalid memory ID");
        require(_score <= 1000, "Score must be <= 1000");

        Memory storage memory_ = memories[_memoryId];

        // Record validation
        ValidationRecord memory record = ValidationRecord({
            validator: msg.sender,
            isValid: _isValid,
            score: _score,
            explanation: _explanation,
            submittedAt: block.timestamp
        });

        validationHistory[_memoryId].push(record);

        // Update memory score (simple average)
        uint256 totalScore = memory_.validationScore * memory_.validationCount +
            _score;
        memory_.validationCount += 1;
        memory_.validationScore = uint16(
            totalScore / memory_.validationCount
        );

        // Mark as validated if threshold reached (3+ validations)
        if (memory_.validationCount >= 3) {
            memory_.isValidated = true;
        }

        // Award reputation to validator
        uint16 reputationDelta = _isValid ? 50 : 25;
        validatorReputation[msg.sender] += reputationDelta;

        emit MemoryValidated(
            _memoryId,
            msg.sender,
            _isValid,
            _score,
            _explanation
        );

        emit ReputationUpdated(
            msg.sender,
            validatorReputation[msg.sender],
            "validator"
        );
    }

    // ==================== Validator Management ====================
    /**
     * @notice Grant validator role to an address (owner only)
     * @param _validator Address to grant validator role
     */
    function setValidator(address _validator, bool _isActive) external onlyOwner {
        if (_isActive) {
            _grantRole(VALIDATOR_ROLE, _validator);
        } else {
            _revokeRole(VALIDATOR_ROLE, _validator);
        }
        emit ValidatorStatusChanged(_validator, _isActive);
    }

    // ==================== Getters ====================
    /**
     * @notice Get memory details by ID
     * @param _memoryId ID of memory to retrieve
     * @return Memory struct
     */
    function getMemory(uint256 _memoryId)
        external
        view
        returns (Memory memory)
    {
        require(_memoryId > 0 && _memoryId < nextMemoryId, "Invalid memory ID");
        return memories[_memoryId];
    }

    /**
     * @notice Get validation history for a memory
     * @param _memoryId ID of memory
     * @return Array of ValidationRecord structs
     */
    function getValidationHistory(uint256 _memoryId)
        external
        view
        returns (ValidationRecord[] memory)
    {
        require(_memoryId > 0 && _memoryId < nextMemoryId, "Invalid memory ID");
        return validationHistory[_memoryId];
    }

    /**
     * @notice Get reputation score for an address
     * @param _address Address to check
     * @param _userType "submitter" or "validator"
     * @return Reputation score
     */
    function getReputation(address _address, string calldata _userType)
        external
        view
        returns (uint256)
    {
        if (
            keccak256(abi.encodePacked(_userType)) ==
            keccak256(abi.encodePacked("submitter"))
        ) {
            return submitterReputation[_address];
        } else if (
            keccak256(abi.encodePacked(_userType)) ==
            keccak256(abi.encodePacked("validator"))
        ) {
            return validatorReputation[_address];
        }
        revert("Invalid user type");
    }

    /**
     * @notice Check if address is an active validator
     * @param _address Address to check
     * @return true if address has VALIDATOR_ROLE
     */
    function isValidator(address _address) external view returns (bool) {
        return hasRole(VALIDATOR_ROLE, _address);
    }

    /**
     * @notice Get total number of memories submitted
     * @return Total count
     */
    function getMemoryCount() external view returns (uint256) {
        return nextMemoryId - 1;
    }

    // ==================== Upgrades ====================
    /// @notice Authorize upgrade to new implementation (owner only)
    function _authorizeUpgrade(address newImplementation)
        internal
        override
        onlyOwner
    {}

    // ==================== Emergency ====================
    /**
     * @notice Emergency pause function (for future enhancement)
     * TODO: Implement pause mechanism with OpenZeppelin PausableUpgradeable
     */
    function emergencyPause() external onlyOwner {
        // TODO: Implement pause
    }

    /**
     * @notice Emergency recovery of stuck funds
     * TODO: Implement with timelock for security
     */
    function emergencyWithdraw() external onlyOwner {
        // TODO: Implement with checks-effects-interactions
    }
}

